import React from 'react';
import styles from '../Navbar.module.css';

function Navbar() {
  return (
    <div className={styles.navbar}>
      <div className={styles.logo}>Logo</div>
      <div className={styles.sections}>
        <ul>
          <li>Inicio</li>
          <li>Sobre mí</li>
          <li>Habilidades</li>
          <li>Proyectos</li>
          <li>Contacto</li>
        </ul>
      </div>
      <div className={styles.options}>
        <div className={styles['dark-mode']}>Modo oscuro / claro</div>
        <div className={styles.language}>Español / Inglés</div>
      </div>
    </div>
  );
}

export default Navbar;
